t-size:1.125em\\\"><strong>Common Traits</strong></span></h3><ul><li><strong>Sensory sensitivities </strong>(noise, light, touch, smells)</li><li><strong>Communication differences </strong>(direct/clear language often preferred, may need extra processing time)</li><li>Strong need for <strong>predictability and routine</strong></li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"ASC Traits\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"db10381c-620a-4ff3-9d18-932cc9dd8ec5\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><span style=\\\"font-size:1.125em\\\"><strong>Strengths</strong></span></h3><ul><li>Attention to detail</li><li>Ability to prepare thoroughly in advance</li><li>Strong self-advocacy when supported</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"ASC Traits\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"6822196c-afa1-4a8b-83f5-25fd9da479b0\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><span style=\\\"font-size:1.125em\\\"><strong>Practice Tips</strong></span></h3><ul><li>Offer clear<strong> step-by-step explanations</strong></li><li><strong>Reduce sensory overload</strong> when possible</li><li><strong>Always check consent before touch or procedures.</strong></li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"ASC Tips\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"9a76abfd-efd3-4f28-aff1-abb3b7fbeec4\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"media\":{\"disableImageZooming\":false},\"answers\":[{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div><strong>Incorrect.</strong> Autistic clients often need predictability and clear explanations. Not giving information increases stress and reduces trust.</div>\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Avoid explaining changes in care</div>\"},{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div><strong>Correct</strong>. Breaking down information into clear steps helps reduce anxiety, supports understanding, and honors the clients need for predictability.</div>\",\"tip\":\"\",\"notChosenFeedback\":\"<div><strong>Correct</strong>. Breaking down information into clear steps helps reduce anxiety, supports understanding, and honors the clients need for predictability.</div>\"},\"text\":\"<div>Offer step-by-step explanations</div>\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div><strong>Incorrect.</strong> Most autistic people are highly sensitive to sensory input. Adding more stimulation (lights, sound, touch) risks overwhelm and distress.</div>\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Increase stimulation to distract</div>\"}],\"overallFeedback\":[{\"from\":0,\"to\":40,\"feedback\":\"Practise makes perfect\"},{\"from\":41,\"to\":80,\"feedback\":\"Well Done\"},{\"from\":81,\"to\":100,\"feedback\":\"Great Job\"}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"showScorePoints\":true},\"UI\":{\"checkAnswerButton\":\"Check\",\"submitAnswerButton\":\"Submit\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"You got :num out of :total points\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wr "text-align:center\\\">Send reminder texts, use visual schedules, and allow flexible appointment times.</p>\",\"tips\":{}},{\"text\":\"<p style=\\\"text-align:center\\\">Has difficulty focusing during long explanations.</p>\",\"answer\":\"<p style=\\\"text-align:center\\\">Break information into small chunks and check in often with short summaries.</p>\",\"tips\":{}},{\"text\":\"<p style=\\\"text-align:center\\\">Gets easily distracted in noisy or busy environments.</p>\",\"answer\":\"<p style=\\\"text-align:center\\\">Reduce external distractions when possible, and give information in calm, focused settings.</p>\",\"tips\":{}}],\"behaviour\":{\"enableRetry\":true,\"disableBackwardsNavigation\":false,\"scaleTextNotCard\":false,\"randomCards\":false,\"maxProficiency\":5,\"quickProgression\":false},\"answer\":\"Turn\",\"next\":\"Next\",\"prev\":\"Previous\",\"retry\":\"Retry\",\"correctAnswer\":\"I got it right!\",\"incorrectAnswer\":\"I got it wrong\",\"round\":\"Round @round\",\"cardsLeft\":\"Cards left: @number\",\"nextRound\":\"Proceed to round @round\",\"startOver\":\"Start over\",\"showSummary\":\"Next\",\"summary\":\"Summary\",\"summaryCardsRight\":\"Cards you got right:\",\"summaryCardsWrong\":\"Cards you got wrong:\",\"summaryCardsNotShown\":\"Cards in pool not shown:\",\"summaryOverallScore\":\"Overall Score\",\"summaryCardsCompleted\":\"Cards you have completed learning:\",\"summaryCompletedRounds\":\"Completed rounds:\",\"summaryAllDone\":\"Well done! You have mastered all @cards cards by getting them correct @max times!\",\"progressText\":\"Card @card of @total\",\"cardFrontLabel\":\"Card front\",\"cardBackLabel\":\"Card back\",\"tipButtonLabel\":\"Show tip\",\"audioNotSupported\":\"Your browser does not support this audio\",\"confirmStartingOver\":{\"header\":\"Start over?\",\"body\":\"All progress will be lost. Are you sure you want to start over?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Start over\"},\"description\":\"<p>Flip the cards to view a li><li><strong>Break tasks into simple steps</strong></li><li><strong>Allow repetition </strong>(e.g., practice babywearing, swaddling).</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Dyslexia Tips\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"3b0b3005-b1b7-45d5-8903-b7cbff013f99\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"media\":{\"disableImageZooming\":false},\"answers\":[{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div><strong>Incorrect</strong>. Dyslexia often makes written materials challenging to process.</div>\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Give a long written handout and ask them to review it later</div>\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div><strong>Incorrect</strong>. While partners can help, relying solely on them may reduce the clients autonomy and confidence.</div>\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Ask the partner to read and explain everything instead</div>\"},{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div><strong>Correct</strong>. Combining verbal explanation with visuals reduces cognitive load and supports understanding.</div>\",\"notChosenFeedback\":\"<div><strong>Correct</strong>. Combining verbal explanation with visuals reduces cognitive load and supports understanding.</div>\"},\"text\":\"<div>Explain cues verbally and use visual aids like pictures or icons</div>\"}],\"overallFeedback\":[{\"from\":0,\"to\":40,\"feedback\":\"Practise makes perfect\"},{\"from\":41,\"to\":80,\"feedback\":\"Well Done\"},{\"from\":81,\"to\":100,\"feedback\":\"Great Job\"}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"con 90f1-66cd-41ab-bb97-8e5ac2cbdaf3\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Strengths</strong></h3><ul><li>Persistence and determination</li><li>Empathy and creativity in finding alternative strategies</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Dyspraxia Strengths\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"e54c2421-e261-4e21-9f5b-b7264a96977e\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Practice Tip</strong></h3><ul><li>Demonstrate skills <strong>slowly</strong></li><li><strong>Break tasks into simple steps</strong></li><li><strong>Allow repetition </strong>(e.g., practice babywearing, swaddling).</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Dyspraxia Tips\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"85dc0ddc-f24e-463d-8ce9-43a4756d1dd5\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"iconType\":\"icon\",\"icon\":\"plus\",\"color\":\"#09b4c3\",\"hotspots\":[{\"position\":{\"x\":16.57777099609375,\"y\":50.97060883601958},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Challenge:</strong> Folding, lifting, and maneuvering strollers may be awkward due to coordination or strength challenges.</p><p><br /><strong>Support:</strong> Demonstrate folding slowly, then guide the client through practice multiple times. Suggest lighter, easy-fold models. Encourage rest breaks to avoid strain.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Stroller\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"ce140e4b-69b6-4ea8-850d-e98aeb9b44d1\"}],\"header\":\"Stroller\"},{\"position\":{\"x\":54.577770996093754,\"y\":36.465512858175906},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Challenge:</strong> Assembling a crib requires sequencing steps and handling multiple parts.</p><p><br /><strong>Support:</strong> Offer step-by-step support with clear visuals. Break tasks into smaller chunks and encourage pacing. If possible, assemble together to reinforce confidence.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Crib\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"160eaac9-5ee1-434a-9d1d-3a0a078bbaa0\"}],\"header\":\"Crib\"},{\"position\":{\"x\":41.37777099609375,\"y\":54.1190636103366},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Challenge:</strong> Handling small parts or setting up toys may be difficult with fine motor skills.</p><p><br /><strong>Support:</strong> Encourage practice at a comfortable pace. Choose equipment with simpler designs. Celebrate small successes to build confidence.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Baby Activity Center\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"1af00ffe-3c92-4d1b-99f0-134cb393943f\"}],\"header\":\"Baby Activity Center\"},{\"position\":{\"x\":72.57777099609375,\"y\":70.38163800940767},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Challenge:</strong> Installing or adjusting a car seat involves strength, coordination, and sequencing multiple straps/clasps.</p><p><br /><strong>Support:</strong> Demonstrate installation slowly, then support the client to repeat the process step by step. Use visual aids or videos. Encourage involving a support partner if available.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Car Seat\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"e2a67b95-2654-42a6-99a0-646bbef9931c\"}],\"header\":\"Car Seat\"},{\"position\":{\"x\":86.97777099609375,\"y\":35.10373444659607},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Challenge:</strong> Assembling or adjusting a highchair may be frustrating due to awkward angles and multiple parts.</p><p><br /><strong>Support:</strong> Break down the process into short, simple steps. Provide repetition opportunities. Suggest models with fewer parts or easier mechanisms if possible.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Highchaird\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"4.0\"},\"subContentId\":\"29cde8ee-6f4d-467f-a022-a3a29b9752e3\"}],\"header\":\"Highchair\"}],\"hotspotNumberLabel\":\"Hotspot #num\",\"closeButtonLabel\":\"Close\",\"disableScaling\":false,\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAACMUAAAYzCAYAAAD+4BiLAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAEu2lUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSfvu78nIGlkPSdXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQnPz4KPHg6eG1wbWV0YSB4bWxuczp4PSdhZG9iZTpuczptZXRhLyc+CjxyZGY6UkRGIHhtbG5zOnJkZj0naHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyc+CgogPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9JycKICB4bWxuczpBdHRyaWI9J2h0dHA6Ly9ucy5hdHRyaWJ1dGlvbi5jb20vYWRzLzEuMC8nPgogIDxBdHRyaWI6QWRzPgogICA8cmRmOlNlcT4KICAgIDxyZGY6bGkgcmRmOnBhcnNlVHlwZT0nUmVzb3VyY2UnPgogICAgIDxBdHRyaWI6Q3JlYXRlZD4yMDI1LTA5LTEwPC9BdHRyaWI6Q3JlYXRlZD4KICAgICA8QXR0cmliOkV4dElkPjdkMzc0Mzc4LTkxYTYtNDE2MC1iOGVlLWUwZmY4ZGY4ZjdkZDwvQXR0cmliOkV4dElkPgogICAgIDxBdHRyaWI6RmJJZD41MjUyNjU5MTQxNzk1ODA8L0F0dHJpYjpGYklkPgogICAgIDxBdHRyaWI6VG91Y2hUeXBlPjI8L0F0dHJp pe\":\"Text\",\"license\":\"CC BY\",\"title\":\"MH strengths\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"09a0d98f-cc59-49da-854b-440e0226723d\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Practice Tip</strong></h3><ul><li>Normalize conversations about mental health.</li><li>Provide reassurance that asking for support is a strength, not a weakness.</li><li>Know referral pathways (therapists, peer support groups, crisis resources).</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"MH Tips\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"53973bbd-bddd-46ec-b1db-efd68fda729b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p><strong>Reflection Question</strong></p><p>How would you normalize a conversation about postpartum anxiety with a client?</p>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Reflection Question\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"cf0f1a16-b9f5-4f09-8667-086d18189b6a\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.18\",\"subContentId\":\"80269e53-6ab7-492b-8053-c5e266f8e182\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"Mental Health\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Mental Health\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA/AAAAF4CAYAAADzIxKSAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAFf4SURBVHhe7d13nF11nf/x9zn3ztzpvaX3TAohPSEEQuiIgILYe1t1sa0 =\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":52,\"height\":52}},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"CC BY\",\"title\":\"Summary Banner\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"a9b84fd8-1580-4efa-a3be-1ff551f784aa\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>As birth professionals, you will encounter clients with a wide range of strengths, challenges, and preferences. Some may identify as neurodivergent, others may not disclose, and many may not even know they fit into these categories. What matters most is how we show up: with flexibility, respect, and curiosity.</p>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Summary 1\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"582df473-4d6a-4e9d-9047-08aef0a59450\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3>Key Takeaways</h3><ul><li><strong>Neurodivergence is multidimensional, not linear.</strong> Each persons traits, strengths, and support needs may shift from day to day or situation to situation.</li><li><strong>Autism:</strong> predictability, sensory awareness, and step-by-step explanations create safety.</li><li><strong>ADHD:</strong> small steps, reminders, and affirmation of creativity support success.</li><li><strong>Dyslexia:</strong> verbal explanations, visuals, and avoiding judgment around literacy help clients thrive.</li><li><strong>Dyspraxia:</strong> breaking down motor tasks, offering repetition, and using simpler equipment builds confidence.</li><li><strong>Sensory Processing Differences:</strong> adjustments to light, sound, or touch can transform the birth environment.</li><li><strong>Mental Health Conditions:</strong> open conversations, normalized support, and clear referral pathways protect dignity and wellbeing.</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Key Takeaways\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"7a0ab0be-f15c-4cd7-b768-34505499ee01\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3>Why This Matters</h3><p>When you adapt your communication and support, youre not just making birth education more accessibleyou are affirming each clients humanity. You are saying: <em>I see you, I hear you, and you are valued.</em></p>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Why this matters\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"20638b1c-ed7e-4958-ad9b-e250eda51c11\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3>Reflection</h3><p>Take a moment to consider:</p><ul><li>Which neurotype did you learn the most from in this section?</li><li>How might you change your practice tomorrow to be more inclusive?</li><li>What resources or tools could you create (visual guides, reminders, sensory supports) that would make your care more accessible?</li></ul>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"CC BY\",\"title\":\"Reflections\",\"authors\":[{\"name\":\"Anzonia Farrant\",\"role\":\"Author\"}],\"changes\":[],\"licenseVersion\":\"2.0\"},\"subContentId\":\"3885dddc-468f-4246-bd09-cfbb75f9fe3d\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.18\",\"subContentId\":\"b9d0fad1-5a57-46fc-8ddb-12d144db8b1c\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"Summary\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Summary\"}},{\"params\":{\"content\":[{\"useSeparator\":\"auto\"}]},\"libra
